export default (function(a,b,c,d,e,f,g,h,i,j,k){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:h,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:h,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:i,pageSize:25,pageCount:i,total:5}}},lrka5m5lp7:{data:{id:148,attributes:{imdbId:"tt0066767",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BOTAxOWYwZmItZTJlMC00MmMzLWFhYmUtMmJmMWYyZTMzMGNhXkEyXkFqcGdeQXVyNjUwNzk3NDc@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"6.4\u002F10"},{Source:"Rotten Tomatoes",Value:"74%"},{Source:"Metacritic",Value:"61\u002F100"}],item_lang:{data:{id:811,attributes:{title:d,plot:"A thief (Duke Anderson) just released from ten years in jail, takes up with his old girlfriend (Ingrid) in her posh apartment. He makes plans to rob the entire building. What he doesn't know is that his every move is recorded on audio and video tape, although he is not the subject of any surveillance.",slug:"the-anderson-tapes"}}},books:{data:[{id:2349,attributes:{title:d,description:j,thumbnail:k,authors:[a],firstBook:true,published:g,publisher:e,subtitle:b}},{id:2350,attributes:{title:d,description:j,thumbnail:k,authors:[a],firstBook:f,published:g,publisher:e,subtitle:b}},{id:2351,attributes:{title:"McNally's Dare",description:"If anyone can connect a dead waiter in a pool, a deceased duchess, and a possibly phony heir, it’s the Palm Beach PI—in this New York Times bestseller. Malcolm MacNiff’s annual Tennis Everyone!fundraiser is the high point of the Palm Beach season. But the glittering A-list event hits rock bottom when a waiter is found floating face down in the pool. Archy McNally instantly suspects foul play. No sooner are his fears confirmed than he has another mystery to solve. Society’s abuzz over the recent arrival of Lance Talbot from Switzerland to claim his half-billion inheritance from his grandmother’s estate, but some claim that Talbot’s a fraud. It falls to McNally to sift through the clues and uncover a murderous scam that stretches from the snowy Alps all the way to sunny Florida.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=-kawJcLnQTIC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a,"Vincent Lardo"],firstBook:f,published:"2013-03-12",publisher:e,subtitle:b}},{id:2352,attributes:{title:"The Eighth Commandment",description:"“Thou shalt not steal is indeed the moral in this light-as-a-bubble comic caper” by the #1 New York Times–bestselling author (People). Appraising rare coins for Grandby & Sons, a venerable Madison Avenue auction house, is a dream come true for Mary Lou Bateson. She even gets a chance to inspect the Havistock Collection of priceless coins, which includes the Demaretion, a rare, ancient Greek silver piece. But when the Demaretion disappears just after her assessment, the young numismatist becomes the number-one suspect. Placed on indefinite leave, Bateson enlists the help of a New York Police Department cop and an insurance detective to go behind the closed doors of one of New York’s most powerful and untouchable families. The Havistocks are keeping some dangerous secrets, including a kleptomaniac daughter, a sex-addicted daughter-in-law, and a sleazy nest of adultery, pornography, and damning secrets someone is willing to kill to keep.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=bnQ_YpXlV4EC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:f,published:g,publisher:e,subtitle:b}},{id:2353,attributes:{title:d,description:"The nationwide bestseller that launched the career of Lawrence Sanders and introduced his most famous character, Edward X. Delaney, hero of the \"Deadly Sin\" series of novels. \"The novel races forward, accelerating in action and suspense\".--The New York Times.",thumbnail:b,authors:[a],firstBook:f,published:"1970-01-01",publisher:"Dell Publishing Company",subtitle:"A Novel"}}]}}},meta:{}}},prerenderedAt:1681703447303}}("Lawrence Sanders","","movie","The Anderson Tapes","Open Road Media",null,"2013-02-12","series",1,"The explosive Edgar Award–winning debut novel—told entirely through surveillance recordings, eyewitness reports, and other “official” documents—by New York Times bestselling author Lawrence Sanders New York City. Summer 1968.Newly sprung from prison, professional burglar John Anderson is preparing for the biggest heist of his criminal career. The mark is a Manhattan luxury apartment building with the tony address of 535 East Seventy-Third Street. Enlisting a crew of scouts, con artists, and a getaway driver, Anderson orchestrates what he believes to be a foolproof plan. To pull off the big score, he needs one last thing: the permission of the local mafia, who expect a piece of the action. But no one inside Anderson’s operation knows that the police have recorded their conversations. The New York Police Department has hatched a plot of its own—but even its task force may not be enough to stop such a cunningly planned robbery.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=hSqthksc65oC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api"))